import './Doctor.css';
import { useState } from 'react';
import Navbar from './Navbar';
import { useRole } from './Context'; 
import React, { useEffect } from 'react';



export default function Doctor() {
    const { role } = useRole();
    console.log("Role in Doctor:", role); // Debugging line to check the role

    useEffect(() => {
        console.log('Doctor component mounted');
      }, []); // If this logic changes anything that could affect the role, be cautious.

    return (
        <div>
            <Navbar />
            <h1>Doctor</h1>
        </div>
    )
}
